import React from "react";
import "./Logo.css";

const img = require("./you(white).jpg");

class Logo extends React.Component {
    render() {
        return (
            <div className="img-container fl">
                <img className="logo" src={img} alt="You.AI"/>
            </div>
        )
    }
}

export default Logo;
